static mp_err point_mul_g_secp256r1(const mp_int *n, mp_int *out_x,
                                    mp_int *out_y, const ECGroup *group) {
    unsigned char b_x[32];
    unsigned char b_y[32];
    unsigned char b_n[32];
    mp_err res;

    ARGCHK(n != NULL && out_x != NULL && out_y != NULL, MP_BADARG);

    /* fail on out of range scalars */
    if (mpl_significant_bits(n) > 256 || mp_cmp_z(n) != 1) return MP_RANGE;

    MP_CHECKOK(mp_to_fixlen_octets(n, b_n, 32));
    MP_BE2LE(b_n);
    point_mul_g(b_x, b_y, b_n);
    MP_BE2LE(b_x);
    MP_BE2LE(b_y);
    MP_CHECKOK(mp_read_unsigned_octets(out_x, b_x, 32));
    MP_CHECKOK(mp_read_unsigned_octets(out_y, b_y, 32));

CLEANUP:
    return res;
}

static mp_err point_mul_secp256r1(const mp_int *n, const mp_int *in_x,
                                  const mp_int *in_y, mp_int *out_x,
                                  mp_int *out_y, const ECGroup *group) {
    unsigned char b_x[32];
    unsigned char b_y[32];
    unsigned char b_n[32];
    mp_err res;

    ARGCHK(n != NULL && in_x != NULL && in_y != NULL && out_x != NULL &&
               out_y != NULL,
           MP_BADARG);

    /* fail on out of range scalars */
    if (mpl_significant_bits(n) > 256 || mp_cmp_z(n) != 1) return MP_RANGE;

    MP_CHECKOK(mp_to_fixlen_octets(n, b_n, 32));
    MP_CHECKOK(mp_to_fixlen_octets(in_x, b_x, 32));
    MP_CHECKOK(mp_to_fixlen_octets(in_y, b_y, 32));
    MP_BE2LE(b_x);
    MP_BE2LE(b_y);
    MP_BE2LE(b_n);
    point_mul(b_x, b_y, b_n, b_x, b_y);
    MP_BE2LE(b_x);
    MP_BE2LE(b_y);
    MP_CHECKOK(mp_read_unsigned_octets(out_x, b_x, 32));
    MP_CHECKOK(mp_read_unsigned_octets(out_y, b_y, 32));

CLEANUP:
    return res;
}

static mp_err point_mul_two_secp256r1(const mp_int *n1, const mp_int *n2,
                                      const mp_int *in_x, const mp_int *in_y,
                                      mp_int *out_x, mp_int *out_y,
                                      const ECGroup *group) {
    unsigned char b_x[32];
    unsigned char b_y[32];
    unsigned char b_n1[32];
    unsigned char b_n2[32];
    mp_err res;

    /* If n2 == NULL, this is just a base-point multiplication. */
    if (n2 == NULL) return point_mul_g_secp256r1(n1, out_x, out_y, group);

    /* If n1 == NULL, this is just an arbitary-point multiplication. */
    if (n1 == NULL)
        return point_mul_secp256r1(n2, in_x, in_y, out_x, out_y, group);

    ARGCHK(in_x != NULL && in_y != NULL && out_x != NULL && out_y != NULL,
           MP_BADARG);

    /* fail on out of range scalars */
    if (mpl_significant_bits(n1) > 256 || mp_cmp_z(n1) != 1 ||
        mpl_significant_bits(n2) > 256 || mp_cmp_z(n2) != 1)
        return MP_RANGE;

    MP_CHECKOK(mp_to_fixlen_octets(n1, b_n1, 32));
    MP_CHECKOK(mp_to_fixlen_octets(n2, b_n2, 32));
    MP_CHECKOK(mp_to_fixlen_octets(in_x, b_x, 32));
    MP_CHECKOK(mp_to_fixlen_octets(in_y, b_y, 32));
    MP_BE2LE(b_x);
    MP_BE2LE(b_y);
    MP_BE2LE(b_n1);
    MP_BE2LE(b_n2);
    point_mul_two(b_x, b_y, b_n1, b_n2, b_x, b_y);
    MP_BE2LE(b_x);
    MP_BE2LE(b_y);
    MP_CHECKOK(mp_read_unsigned_octets(out_x, b_x, 32));
    MP_CHECKOK(mp_read_unsigned_octets(out_y, b_y, 32));

CLEANUP:
    return res;
}

mp_err ec_group_set_secp256r1(ECGroup *group, ECCurveName name) {
    if (name == ECCurve_NIST_P256) {
        group->base_point_mul = &point_mul_g_secp256r1;
        group->point_mul = &point_mul_secp256r1;
        group->points_mul = &point_mul_two_secp256r1;
    }
    return MP_OKAY;
}
