static const unsigned char const_g[65] = {
    /* uncompressed */
    0x04,
    /* x(G) */
    0x6B, 0x17, 0xD1, 0xF2, 0xE1, 0x2C, 0x42, 0x47, 0xF8, 0xBC, 0xE6, 0xE5,
    0x63, 0xA4, 0x40, 0xF2, 0x77, 0x03, 0x7D, 0x81, 0x2D, 0xEB, 0x33, 0xA0,
    0xF4, 0xA1, 0x39, 0x45, 0xD8, 0x98, 0xC2, 0x96,
    /* y(G) */
    0x4F, 0xE3, 0x42, 0xE2, 0xFE, 0x1A, 0x7F, 0x9B, 0x8E, 0xE7, 0xEB, 0x4A,
    0x7C, 0x0F, 0x9E, 0x16, 0x2B, 0xCE, 0x33, 0x57, 0x6B, 0x31, 0x5E, 0xCE,
    0xCB, 0xB6, 0x40, 0x68, 0x37, 0xBF, 0x51, 0xF5};

/*-
 * Implements the "mul" function pointer inside OpenSSL's EC_METHOD.
 * Relevant cases:
 * r := scalar * G (calls fixed scmul wrapper)
 * r := scalars[0] * points[0] (calls variable scmul wrapper)
 * r := scalar * G + scalars[0] * points[0] (calls simultaneous scmul wrapper)
 * Anything else, it reverts to the default and also when:
 * - using a custom generator
 * - using out of range scalars
 */
static int ec_GFp_mul_secp256r1(const EC_GROUP *group, EC_POINT *r,
                                const BIGNUM *scalar, size_t num,
                                const EC_POINT **points, const BIGNUM **scalars,
                                BN_CTX *ctx) {
    if (group == NULL || r == NULL || ctx == NULL)
        return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);

    /* check for custom generator */
    if (scalar != NULL) {
        unsigned char buf_g[65];

        if (EC_POINT_point2oct(group, EC_GROUP_get0_generator(group),
                               POINT_CONVERSION_UNCOMPRESSED, buf_g, 65,
                               ctx) != 65)
            return 0;

        /* on generator mismatch, use the default */
        if (memcmp(const_g, buf_g, 65) != 0)
            return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
    }

    if (scalar != NULL && num == 1 && scalars != NULL && scalars[0] != NULL &&
        points != NULL && points[0] != NULL) {
        /* verification */
        if (BN_num_bits(scalar) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalar) ||
            BN_num_bits(scalars[0]) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalars[0]))
            return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
        return point_mul_two_secp256r1(group, r, scalar, points[0], scalars[0],
                                       ctx);
    } else if (scalar != NULL && num == 0) {
        /* mul g */
        if (BN_num_bits(scalar) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalar))
            return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
        return point_mul_g_secp256r1(group, r, scalar, ctx);
    } else if (scalar == NULL && num == 1 && scalars[0] != NULL &&
               points != NULL && points[0] != NULL) {
        /* mul */
        if (BN_num_bits(scalars[0]) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalars[0]))
            return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
        return point_mul_secp256r1(group, r, points[0], scalars[0], ctx);
    }
    return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
}

